import styled from 'styled-components';


export const SignOut = styled.div `
	{
		padding-right: 1em;
		font-size: 1.3em;
		height: 10%;
		position: relative;
    float: right;

		@media screen and (max-width: 620px) {
			{
			  display: none;
			}
		  }
	}
`;
